import Apcard from "./apcard";

function Landing(){
    return(
        <div>
            <Apcard
                heading="Uplinks"
                count="2/3"
                status="Healthy"
            />
            <Apcard
                heading="Switches"
                count="11/25"
                status="Healthy"
            />
        </div>
    )
}

export default Landing;
